import React from 'react';
import { useTranslation } from 'react-i18next';
import { Container, Typography, Grid, Card, CardContent, CardHeader } from '@material-ui/core';
import ServiceTutorial from '../components/ServiceTutorial';

const ServicesPage = () => {
  const { t } = useTranslation();

  return (
    <Container>
      <Typography variant="h2" gutterBottom>
        {t('services')}
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Card>
            <CardHeader title={t('aadhaar')} />
            <CardContent>
              <Typography>{t('aadhaarDescription')}</Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12}>
          <ServiceTutorial />
        </Grid>
      </Grid>
    </Container>
  );
};

export default ServicesPage;
